import './HeroBanner.css';


function HeroBanner (props) {
  React.useEffect(() => {
    var c = document.getElementById("myCanvas");
    var ctx = c.getContext("2d");
    ctx.moveTo(0, 0);
    ctx.lineTo(200, 100);
    ctx.stroke();
  }, []);
    return (
    <div className="hero-container">
            <canvas
        id="myCanvas"
        width="200"
        height="100"
        style={{ border: "1px solid #d3d3d3" }}
      >
        Your browser does not support the HTML canvas tag.
        <div className="content">
          <h1 className="title">Making sure you business is ready for the internet</h1>
          <p className="subtitle">Digital Marketing and Software Development</p>
          <p className='Message'>You should get PLUGGED IN</p>
          <button className='scroll-button'>Start Now</button>
        </div>
      </canvas>
    </div>
    );
}

export default HeroBanner;
